INSERT INTO `contenidos` (`id`, `imagen`, `titulo_es`, `subtitulo_es`, `texto_es`, `titulo_en`, `subtitulo_en`, `texto_en`, `titulo_br`, `subtitulo_br`, `texto_br`, `texto2_es`, `texto2_en`, `texto2_br`, `ruta`, `orden`, `seccion`, `created_at`, `updated_at`) VALUES
(1, 'contenidos__home1.jpg', 'TALLER BAIGORRIA', 'Nuestra Historia', '<p>Somos una industria metal&uacute;rgica 100% argentina fundada en 1960, dedicada a la fabricaci&oacute;n de elementos de sujeci&oacute;n. Nos especializamos en la producci&oacute;n de ESP&Aacute;RRAGOS, BULONES (PERNOS / BIRLOS), TORNILLOS y TUERCAS para el sector Automotr&iacute;z, Agr&iacute;cola, Maquinaria Vial e Industrial.</p>', 'TALLER BAIGORRIA', 'Our History', '<p>We are a 100% Argentine metallurgical industry founded in 1960, dedicated to the manufacture of fasteners. We specialize in the production of STUDS, BOLTS, SCREWS and NUTS for the Automotive, Agricultural, Road and Industrial Machinery sector.</p>', 'TALLER BAIGORRIA', 'Nossa história', '<p>Somos uma ind&uacute;stria 100% metal&uacute;rgica argentina fundada em 1960, dedicada &agrave; fabrica&ccedil;&atilde;o de fixadores. Somos especializados na produ&ccedil;&atilde;o de PRISIONEIROS,&nbsp;PARAFUSOS e PORCAS para o setor Automotivo, Agr&iacute;cola, Rodovi&aacute;rio e M&aacute;quinas Industriais.</p>', NULL, NULL, NULL, '#', 'AA', 'home', NULL, '2019-02-08 18:36:35'),
(2, 'contenidos__empresa.jpg', 'TALLER BAIGORRIA', 'Nuestra Historia', '<p>Somos una industria metal&uacute;rgica 100% argentina fundada en 1960, dedicada a la fabricaci&oacute;n de elementos de sujeci&oacute;n. Nos especializamos en la producci&oacute;n de ESP&Aacute;RRAGOS, BULONES (PERNOS / BIRLOS), TORNILLOS y TUERCAS para el sector AUTOMOTRIZ, AGR&Iacute;COLA, de MAQUINARIA VIAL e INDUSTRIAL. En Taller Baigorria encontrar&aacute; una ventaja &uacute;nica en el mundo: la m&aacute;s variada gama de esp&aacute;rragos para uso automotor, industrial y agr&iacute;cola, con stock permanente. Gracias a una experiencia de m&aacute;s de 50 a&ntilde;os, hemos logrado estandarizar las diversas l&iacute;neas de producto, garantizando la existencia de una alternativa para solucionar la falta de la pieza original. Todo esto respaldado t&eacute;cnicamente por la utilizaci&oacute;n de normas automotrices, DIN y ASTM. Contamos tambi&eacute;n con una amplia gama de bulones para rueda y maza automotor de diversas marcas de veh&iacute;culos &ndash;europeas, norteamericanas y orientales-.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '#', 'AA', 'empresa', NULL, '2018-12-06 21:11:41'),
(3, 'no-imagen.jpg', 'titulo español', 'subtitulo español', 'texto español', 'titulo english', 'subtitulo english', 'texto english', 'titulo portugues', 'subtitulo portugues', 'texto portugues', NULL, NULL, NULL, '#', NULL, 'contacto', NULL, NULL),
(4, 'no-imagen.jpg', 'Acepto los términos y condiciones de privacidad', 'Términos y condiciones de privacidad', '<p>T&eacute;rminos y condiciones de privacidad</p>', 'I accept the terms and conditions of privacy', 'Terms and conditions of privacy', '<p>Terms and conditions of privacy</p>', 'Eu aceito os termos e condições de privacidade', 'Termos e condições de privacidade', '<p>Termos e condi&ccedil;&otilde;es de privacidade</p>', NULL, NULL, NULL, '#', 'AA', 'condiciones', NULL, '2018-12-21 16:41:40'),
(5, 'contenidos__home2.jpg', 'MÁS DE 60 AÑOS DE EXPERIENCIA', 'El más variado Catálogo', '<p>En Taller Baigorria encontrar&aacute; una ventaja &uacute;nica en el mundo: la m&aacute;s variada gama de esp&aacute;rragos para uso automotor, industrial y agr&iacute;cola, con stock permanente. Gracias a una experiencia de m&aacute;s de 60 a&ntilde;os, hemos logrado estandarizar las diversas l&iacute;neas de producto, garantizando la existencia de una alternativa para solucionar la falta de la pieza original.&nbsp;</p>', 'MORE THAN 60 YEARS OF EXPERIENCE', 'An extensive catalogue', '<p>In Taller Baigorria you will find a unique advantage in the world: a wide range of studs for automotive, industrial and agricultural use, with permanent stock. Thanks to more than 60 years of experience, we have managed to standarize different lines of production. In our catalogue it is possible to find an alternative for each original piece.</p>', 'MAIS DE 60 ANOS DE EXPERIÊNCIA', 'Um extenso catálogo', '<p>Em Taller Baigorria voc&ecirc; encontrar&aacute; uma vantagem &uacute;nica no mundo: a mais variada gama de prisioneiros para uso automotivo, industrial e agr&iacute;cola,&nbsp;com estoque permanente. Gra&ccedil;as a uma experi&ecirc;ncia de mais de 60 anos, conseguimos padronizar as diferentes linhas de produtos, garantindo a exist&ecirc;ncia de uma alternativa para solucionar a falta da pe&ccedil;a original.</p>', NULL, NULL, NULL, NULL, 'BB', 'home', '2018-12-07 15:20:14', '2019-02-08 19:53:22'),
(6, 'contenidos__home3.jpg', '¿QUIÉNES SOMOS?', 'Misión y Visión', '<p>Es nuestra misi&oacute;n en Taller Baigorria satisfacer las necesidades del cliente, tanto en el mercado interno como externo, fabricando y entregando productos de calidad y seguridad, con responsabilidad, compromiso y a precios competitivos. Nuestro desaf&iacute;o es superarnos d&iacute;a a d&iacute;a en la innovaci&oacute;n tecnol&oacute;gica, la capacitaci&oacute;n y la inversi&oacute;n productiva.</p>', 'ABOUT US', 'Mission and vision', '<p>Our mission in Taller Baigorria is to satisfy the needs of both domestic and foreign&nbsp;clients. We value&nbsp;responsibility, comitment and competitive prices in order to manufacture&nbsp;and deliver quality products that&nbsp;guarantee&nbsp;safety. We strive to continuously better ourselves investing in technology, training and new developments.</p>', 'NOSSA HISTÓRIA', 'Missão e visão', '<p>&Eacute; nossa miss&atilde;o na Taller Baigorria satisfazer as necessidades do cliente, tanto no mercado interno quanto externo, fabricando e entregando produtos de qualidade e seguran&ccedil;a, com responsabilidade, comprometimento e pre&ccedil;os competitivos. Nosso desafio &eacute; nos aprimorar dia a dia em inova&ccedil;&atilde;o tecnol&oacute;gica, treinamento e investimento produtivo.</p>', NULL, NULL, NULL, NULL, 'CC', 'home', '2018-12-07 15:21:29', '2019-02-08 20:57:52'),
(7, 'contenidos__map.fw.png', 'Exportamos a más de 15 países de América, Europa y África', '+ presencia en toda la República Argentina', '<p>Nuestras ventas est&aacute;n orientadas tanto al mercado interno como externo. Tenemos presencia en toda la Rep&uacute;blica Argentina y exportamos a m&aacute;s de 15 pa&iacute;ses de Am&eacute;rica, Europa y &Aacute;frica. Proveemos a terminales automotrices y empresas autopartistas certificadas. Nuestros altos est&aacute;ndares de calidad de producto y control de procesos nos respaldan.</p>', 'We export to more than 15 countries in America, Europe and Africa', '+ presence throughout the Argentine Republic', '<p>Our sales are oriented to both domestic and foreign&nbsp;markets. We have presence throughout&nbsp;Argentina&nbsp;and export to more than 15 countries in America, Europe and Africa. We provide automotive terminals and certified auto parts companies. We value our&nbsp;high standards of&nbsp;quality and process control.</p>', 'Nós exportamos para mais de 15 países na América, Europa e África', '+ presença em toda a República Argentina  ', '<p>Nossas vendas s&atilde;o orientadas para os mercados interno e externo. Temos presen&ccedil;a em toda a Rep&uacute;blica Argentina e exportamos para mais de 15 pa&iacute;ses na Am&eacute;rica, Europa e &Aacute;frica. Fornecemos terminais automotivos e empresas certificadas de autope&ccedil;as. Nossos altos padr&otilde;es de qualidade de produto e controle de processo nos apoiam.</p>', '<p><span style=\"font-size:22px\"><strong>Conforman nuestra cartera de clientes</strong></span></p>\r\n\r\n<p>&middot; Distribuidores y mayoristas del mercado de reposici&oacute;n automotriz (aftermarket)</p>\r\n\r\n<p>&middot; Fabricantes de maquinaria agr&iacute;cola</p>\r\n\r\n<p>&middot; Fabricantes de maquinas viales</p>\r\n\r\n<p>&middot; Fabricantes de ejes originales para camiones y remolques</p>\r\n\r\n<p>&middot; Industrias el&eacute;ctricas</p>\r\n\r\n<p>&middot; Terminales automotrices</p>', '<p><span style=\"font-size:22px\"><strong>Our client portfolio</strong></span></p>\r\n\r\n<p>&middot; Distributors and wholesalers of the automotive aftermarket</p>\r\n\r\n<p>&middot; Manufacturers of agricultural machinery</p>\r\n\r\n<p>&middot; Manufacturers of road machines</p>\r\n\r\n<p>&middot; Manufacturers of original axles for trucks and trailers</p>\r\n\r\n<p>&middot; Electrical industries</p>\r\n\r\n<p>&middot; Automotive terminals</p>', '<p><span style=\"font-size:22px\"><strong>Nossa carteira de clientes</strong></span></p>\r\n\r\n<p>&middot; Distribuidores e atacadistas do mercado de reposi&ccedil;&atilde;o automotivo</p>\r\n\r\n<p>&middot; Fabricantes de m&aacute;quinas agr&iacute;colas</p>\r\n\r\n<p>&middot; Fabricantes de m&aacute;quinas rodovi&aacute;rias</p>\r\n\r\n<p>&middot; Fabricantes de eixos originais para caminh&otilde;es e reboques</p>\r\n\r\n<p>&middot; Ind&uacute;strias El&eacute;tricas</p>\r\n\r\n<p>&middot; Terminais automotivos<br />\r\n&nbsp;</p>', NULL, 'AA', 'exportacion', '2018-12-07 17:21:20', '2019-02-08 23:15:57'),
(8, 'contenidos__img.jpg', 'Política de Calidad Taller Baigorria', NULL, '<p>La calidad de nuestras piezas responde a&nbsp;normas internacionales</p>', 'Taller Baigorria Quality Policy', NULL, '<p>We have international certifications for the quality of our products</p>', 'Política de Qualidade do Taller Baigorria', NULL, '<p>Comprometida com a mais alta qualidade de nossos produtos sob padr&otilde;es internacionais</p>', NULL, NULL, NULL, NULL, 'AA', 'calidad', '2018-12-07 17:29:05', '2019-02-09 01:10:24'),
(9, 'contenidos__quality.jpg', 'Aseguramos la excelencia de calidad de nuestros productos', NULL, '<p>En Taller Baigorria contamos con la certificaci&oacute;n ISO-9001 y estamos en proceso de certificaci&oacute;n ISO-TS 16949. Todos nuestros productos son fabricados en aceros aleados comprados directamente en acer&iacute;as locales e internacionales: SAE 10B22, SAE 1038, SAE 4140, SAE 5135, SAE 51B35, PL22D y PL30 con el tratamiento t&eacute;rmico y recubrimiento superficial adecuado, garantizando las calidades 8.8, 10.9, 12.9, G5 y G8 seg&uacute;n corresponda.</p>\r\n\r\n<p>Nuestro proceso de fabricaci&oacute;n esta certificado desde el suministro de la materia prima de cada uno de los materiales utilizados, pasando por la fabricaci&oacute;n del producto y finalmente con la certificaci&oacute;n de calidad de los tratamientos t&eacute;rmicos y superficiales realizados externamente para lo cual contamos con proveedores certificados y de amplia trayectoria en el mercado.</p>', 'Ensuring the excellent quality of our products', NULL, '<p>In Taller Baigorria we have the ISO-9001 certification and we are in the ISO-TS 16949 certification process. All our products are manufactured in alloyed steel purchased directly from local and international steelworks: SAE 10B22, SAE 1038, SAE 4140, SAE 5135, SAE 51B35, PL22D and PL30 with the thermal treatment and adequate surface coating, guaranteeing the qualities 8.8, 10.9, 12.9, G5 and G8 as appropriate.</p>\r\n\r\n<p>Our manufacturing process is certified from the supply&nbsp;of the raw materials, through the manufacture of the product and finally with the quality certification of thermal and surface treatments performed externally for which we have suppliers certificates and extensive experience in the market.</p>', 'Nós garantimos a excelência de qualidade de nossos produtos', NULL, '<p>Em Taller Baigorria temos a certifica&ccedil;&atilde;o ISO-9001 e estamos nos processos de certifica&ccedil;&atilde;o ISO-TS 16949 nos pr&oacute;ximos meses. Todos os nossos produtos s&atilde;o fabricados em a&ccedil;o ligado adquirido diretamente de sider&uacute;rgicas locais e internacionais: SAE 10B22, SAE 1038, SAE 4140, SAE 5135, SAE 51B35, PL22D e PL30 com o tratamento t&eacute;rmico e revestimento superficial adequado, garantindo as qualidades 8.8, 10.9, 12.9, G5 e G8 conforme apropriado.</p>\r\n\r\n<p>Nosso processo de fabrica&ccedil;&atilde;o &eacute; certificado a partir do fornecimento de mat&eacute;ria-prima com certifica&ccedil;&otilde;es de cada um dos materiais utilizados, atrav&eacute;s da fabrica&ccedil;&atilde;o do produto e, finalmente, com a certifica&ccedil;&atilde;o da qualidade dos tratamentos t&eacute;rmicos e de superf&iacute;cie realizados externamente para os quais temos fornecedores certificados e ampla experi&ecirc;ncia no mercado.</p>', NULL, NULL, NULL, NULL, 'BB', 'calidad', '2018-12-10 14:35:49', '2019-02-09 02:03:39'),
(10, 'contenidos__i3.png', 'Taller Baigorria', 'Taller Baigorria', '<p>En Taller Baigorria encontrar&aacute; una ventaja &uacute;nica en el mundo: la m&aacute;s variada gama de esp&aacute;rragos para uso automotor, industrial y agr&iacute;cola, con stock permanente. Gracias a una experiencia de m&aacute;s de 50 a&ntilde;os, hemos logrado estandarizar las diversas l&iacute;neas de producto, garantizando la existencia de una alternativa para solucionar la falta de la pieza original.&nbsp;</p>', 'Taller Baigorria', 'Taller Baigorria', '<p>At Taller Baigorria you will find a unique advantage in the world: the most varied range of asparagus for automotive, industrial and agricultural use, with permanent stock. Thanks to an experience of more than 50 years, we have managed to standardize the various product lines, guaranteeing the existence of an alternative to solve the lack of the original part.</p>', 'Taller Baigorria', 'Taller Baigorria', '<p>Em Taller Baigorria voc&ecirc; encontrar&aacute; uma vantagem &uacute;nica no mundo: a mais variada gama de aspargos para uso automotivo, industrial e agr&iacute;cola, com estoque permanente. Gra&ccedil;as a uma experi&ecirc;ncia de mais de 50 anos, conseguimos padronizar as diversas linhas de produtos, garantindo a exist&ecirc;ncia de uma alternativa para solucionar a falta da pe&ccedil;a original.</p>', NULL, NULL, NULL, NULL, 'AA', 'privatezone', '2018-12-27 17:57:55', '2018-12-28 22:31:50'),
(11, 'contenidos__i3.png', 'Taller Baigorria', NULL, '<p>En Taller Baigorria encontrar&aacute; una ventaja &uacute;nica en el mundo: la m&aacute;s variada gama de esp&aacute;rragos para uso automotor, industrial y agr&iacute;cola, con stock permanente. Gracias a una experiencia de m&aacute;s de 50 a&ntilde;os, hemos logrado estandarizar las diversas l&iacute;neas de producto, garantizando la existencia de una alternativa para solucionar la falta de la pieza original.&nbsp;</p>', 'Taller Baigorria', NULL, '<p>At Taller Baigorria you will find a unique advantage in the world: the most varied range of asparagus for automotive, industrial and agricultural use, with permanent stock. Thanks to an experience of more than 50 years, we have managed to standardize the various product lines, guaranteeing the existence of an alternative to solve the lack of the original part.</p>', 'Taller Baigorria', NULL, '<p>Em Taller Baigorria voc&ecirc; encontrar&aacute; uma vantagem &uacute;nica no mundo: a mais variada gama de aspargos para uso automotivo, industrial e agr&iacute;cola, com estoque permanente. Gra&ccedil;as a uma experi&ecirc;ncia de mais de 50 anos, conseguimos padronizar as diversas linhas de produtos, garantindo a exist&ecirc;ncia de uma alternativa para solucionar a falta da pe&ccedil;a original.</p>', NULL, NULL, NULL, NULL, 'BB', 'privatezone', '2018-12-27 17:57:55', '2018-12-27 17:57:55'),
(12, 'contenidos__i3.png', 'Baigorria', NULL, '<p>En Taller Baigorria encontrar&aacute; una ventaja &uacute;nica en el mundo: la m&aacute;s variada gama de esp&aacute;rragos para uso automotor, industrial y agr&iacute;cola, con stock permanente. Gracias a una experiencia de m&aacute;s de 50 a&ntilde;os, hemos logrado estandarizar las diversas l&iacute;neas de producto, garantizando la existencia de una alternativa para solucionar la falta de la pieza original.&nbsp;</p>', 'Baigorria', NULL, '<p>At Taller Baigorria you will find a unique advantage in the world: the most varied range of asparagus for automotive, industrial and agricultural use, with permanent stock. Thanks to an experience of more than 50 years, we have managed to standardize the various product lines, guaranteeing the existence of an alternative to solve the lack of the original part.</p>', 'Baigorria', NULL, '<p>Em Taller Baigorria voc&ecirc; encontrar&aacute; uma vantagem &uacute;nica no mundo: a mais variada gama de aspargos para uso automotivo, industrial e agr&iacute;cola, com estoque permanente. Gra&ccedil;as a uma experi&ecirc;ncia de mais de 50 anos, conseguimos padronizar as diversas linhas de produtos, garantindo a exist&ecirc;ncia de uma alternativa para solucionar a falta da pe&ccedil;a original.</p>', NULL, NULL, NULL, NULL, 'CC', 'privatezone', '2018-12-27 17:57:55', '2018-12-27 17:57:55');
